import React, {useState} from 'react';
import {Col, Row, Form, Switch, Button, Descriptions} from 'antd';
import { Typography } from 'antd';
import { AudioOutlined } from '@ant-design/icons';
import { List, Input, Space } from 'antd';
import axios from "axios";
import Card from "antd/es/card/Card";
const { Search } = Input;


const Home = () => {
    const { Title } = Typography;
    const suffix = (
        <AudioOutlined
            style={{
                fontSize: 16,
                color: '#1890ff',
            }}
        />
    );
    const onSearch = (value) => {
        console.log(value);
        let url = 'http://localhost:8080/stock/queryprice/' + value;
        axios.get(url)
            .then(function (response) {
                let data=response.data.data;
                if(data !== "-1"){
                    console.log(data);

                }else{
                    console.log("fuck");
                }
            })
            .catch(function (error) {
                console.log(error);
            });
    };

    return (
        <div>
            <Title level={1}>STOCK MANAGEMENT</Title>
            <div>
                <Row>
                    <Col span ={8}></Col>
                    <Col span ={8}>
                        <Space>
                            <Search
                                placeholder="Input stock sym"
                                enterButton="Query"
                                size="large"
                                onSearch={onSearch}
                            />
                        </Space>
                    </Col>
                    <Col span ={8}></Col>
                </Row>
            </div>
            <div className="site-card-wrapper">
                <Row gutter={16}>
                    <Col span={8}>
                        <Card title="Card title" bordered={false}>
                            Card content
                        </Card>
                    </Col>
                    <Col span={8}>
                        <Card title="Card title" bordered={false}>
                            Card content
                        </Card>
                    </Col>
                    <Col span={8}>
                        <Card title="Card title" bordered={false}>
                            Card content
                        </Card>
                    </Col>
                </Row>
            </div>
        </div>
    );
};

export default Home;
